import { useState, useEffect } from 'react';
import './StudentManagement.css';

function StudentManagement() {
    const [students, setStudents] = useState([]);
    const [newStudent, setNewStudent] = useState({
        name: '',
        age: '',
        grade: '',
        email: '',
    });

    // Giả sử dữ liệu học viên được lấy từ API hoặc localStorage
    useEffect(() => {
        // Mô phỏng lấy dữ liệu từ API hoặc localStorage
        const savedStudents = JSON.parse(localStorage.getItem('students')) || [];
        setStudents(savedStudents);
    }, []);

    // Hàm thêm học viên mới
    const handleAddStudent = () => {
        if (!newStudent.name || !newStudent.age || !newStudent.grade || !newStudent.email) {
            alert('Vui lòng điền đầy đủ thông tin');
            return;
        }

        const updatedStudents = [...students, newStudent];
        setStudents(updatedStudents);
        localStorage.setItem('students', JSON.stringify(updatedStudents));
        setNewStudent({ name: '', age: '', grade: '', email: '' }); // Reset form
    };

    // Hàm xóa học viên
    const handleDeleteStudent = (index) => {
        const updatedStudents = students.filter((_, i) => i !== index);
        setStudents(updatedStudents);
        localStorage.setItem('students', JSON.stringify(updatedStudents));
    };

    return (
        <div className="student-management">
            <h1>Quản Lý Học Viên</h1>

            {/* Form thêm học viên */}
            <div className="add-student-form">
                <h2>Thêm Học Viên</h2>
                <input
                    type="text"
                    placeholder="Tên học viên"
                    value={newStudent.name}
                    onChange={(e) => setNewStudent({ ...newStudent, name: e.target.value })}
                />
                <input
                    type="number"
                    placeholder="Tuổi"
                    value={newStudent.age}
                    onChange={(e) => setNewStudent({ ...newStudent, age: e.target.value })}
                />
                <input
                    type="text"
                    placeholder="Khối lớp"
                    value={newStudent.grade}
                    onChange={(e) => setNewStudent({ ...newStudent, grade: e.target.value })}
                />
                <input
                    type="email"
                    placeholder="Email"
                    value={newStudent.email}
                    onChange={(e) => setNewStudent({ ...newStudent, email: e.target.value })}
                />
                <button onClick={handleAddStudent}>Thêm Học Viên</button>
            </div>

            {/* Danh sách học viên */}
            <div className="student-list">
                <h2>Danh Sách Học Viên</h2>
                <table>
                    <thead>
                        <tr>
                            <th>Tên</th>
                            <th>Tuổi</th>
                            <th>Khối Lớp</th>
                            <th>Email</th>
                            <th>Thao Tác</th>
                        </tr>
                    </thead>
                    <tbody>
                        {students.map((student, index) => (
                            <tr key={index}>
                                <td>{student.name}</td>
                                <td>{student.age}</td>
                                <td>{student.grade}</td>
                                <td>{student.email}</td>
                                <td>
                                    <button onClick={() => handleDeleteStudent(index)}>Xóa</button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
}

export default StudentManagement;
